categories:
- description: HADDOCK3 modules to score modules.
  name: scoring
- description: HADDOCK3 modules to create topologies.
  name: topology
- description: HADDOCK3 modules related to model analysis.
  name: analysis
- description: HADDOCK3 actions referring to refinement.
  name: refinement
- description: HADDOCK3 modules for sampling.
  name: sampling
global:
  schema:
    properties:
      molecules:
        items:
          format: uri-reference
          type: string
        maxItems: 10
        minItems: 2
        title: Molecules
        type: array
      ncores:
        default: 8
        title: Number of cpu cores
        type: number
      run_dir:
        title: Run directory
        type: string
    required:
    - molecules
    - run_dir
    type: object
  uiSchema:
    molecules:
      items:
        ui:options:
          accept: .pdb
        ui:widget: file
nodes:
- category: analysis
  description: HADDOCK3 module to select top cluster/model.
  id: seletop
  label: HADDOCK3 module to select a top cluster/model.
  schema:
    properties:
      select:
        default: 400
        maximum: 9999
        minimum: -9999
        type: number
    required: []
    type: object
  uiSchema: {}
- category: analysis
  description: Haddock Module for 'seletopclusts'.
  id: seletopclusts
  label: HADDOCK3 module to select a top cluster/model.
  schema:
    properties:
      top_cluster:
        default:
        - 1
        - 2
        - 3
        - 4
        items:
          type: number
        type: array
      top_models:
        default: 4
        maximum: 9999
        minimum: -9999
        type: number
    required: []
    type: object
  uiSchema: {}
- category: analysis
  description: HADDOCK3 module to calculate the CAPRI metrics.
  id: caprieval
  label: Calculate CAPRI metrics.
  schema:
    properties:
      alignment_method:
        default: sequence
        maxLength: 9999
        type: string
      dockq:
        default: true
        type: boolean
      fnat:
        default: true
        type: boolean
      fnat_cutoff:
        default: 5.0
        maximum: 9999
        minimum: -9999
        type: number
      ilrmsd:
        default: true
        type: boolean
      irmsd:
        default: true
        type: boolean
      irmsd_cutoff:
        default: 10.0
        maximum: 9999
        minimum: -9999
        type: number
      ligand_chain:
        default: B
        maxLength: 9999
        type: string
      lovoalign_exec:
        default: ''
        maxLength: 9999
        type: string
      lrmsd:
        default: true
        type: boolean
      lrmsd_cutoff:
        default: 10.0
        maximum: 9999
        minimum: -9999
        type: number
      rank_ascending:
        default: true
        type: boolean
      rankby:
        default: score
        maxLength: 9999
        type: string
      receptor_chain:
        default: A
        maxLength: 9999
        type: string
      reference_fname:
        format: uri-reference
        type: string
      sort_ascending:
        default: true
        type: boolean
      sortby:
        default: score
        maxLength: 9999
        type: string
    required: []
    type: object
  uiSchema:
    reference_fname:
      ui:widget: file
- category: sampling
  description: HADDOCK3 gdock module.
  id: gdock
  label: HADDOCK3 gdock integration module.
  schema:
    properties:
      ambig_fname:
        format: uri-reference
        type: string
    required: []
    type: object
  uiSchema:
    ambig_fname:
      ui:widget: file
